import React from 'react';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import { makeStyles } from '@material-ui/core/styles';

// hooks
import { useFetch } from '../../../hooks';

const useStyles = makeStyles({
  root: {
    minWidth: 275,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

const IntitutionInformation = () => {
  const classes = useStyles();
  const { data } = useFetch('/institutions/group');
  return data.map((information) =>
    information.data.map((innerData) => (
      <Card className={classes.root}>
        <CardHeader
          style={{ backgroundColor: '#FF6F00', color: 'white' }}
          title={`${information.buildingName}`}
        >
          Clinic: {innerData.clinic}
        </CardHeader>
        <CardContent>
          <Typography variant="body2" component="h2">
            Address: {innerData.address}
          </Typography>
          <Typography variant="body2" component="h2">
            Phone: {innerData.phone}
          </Typography>
        </CardContent>
      </Card>
    ))
  );
};
export default IntitutionInformation;
